import React from 'react';
import Card from './Card'

const CardBlock = (props) => {

	const renderCards = (props) => (
		<div>props.list.length </div>
	)

  return (
    <div className='card_block'>
      <div className='container'>
      	{
      		props.title ?
      			<div className='title'>
      				{props.title}
      			</div>
      		: null
      	}

      	<div style={{
      		display:'flex',
      		flexWrap:'wrap'
      	}}>
      		{ renderCards(props) }
      	</div>
      </div>
    </div>

  )
}
export default CardBlock;
